import React from "react";

export const ChartBar = (props) => {
  const value = Math.round(props.value / props.maxValue) * 100 + "&+%";
  console.log(value);
  return (
    <>
      <div className="chart_outer" style={{ height: value }}>
        <div className="chartBar"></div>
      </div>
      <p className="label">{props.label}</p>
    </>
  );
};
